.header {
  position: absolute;
  z-index: 999;
  width: 100%;
  overflow: hidden;

  &__section {
    display: flex;
    padding-top: 6px;
    padding-left: 10px;
    padding-right: 10px;
    margin-left: auto;
    margin-right: auto;

    // width: 100%;
    // height: 100%;

    @media screen and (min-width: 480px) {
      width: 480px;
      padding-left: 20px;
      padding-right: 20px;
    }
    @media screen and (min-width: 768px) {
      width: 768px;
      padding-left: 34px;
      padding-right: 34px;
      padding-top: 37px;
    }
    @media screen and (min-width: 1280px) {
      width: 1280px;
      padding-left: 46px;
      padding-right: 46px;
    }
  }

  &__nav {
    display: flex;
    align-items: center;
  }

  &__logo {
    text-decoration: none;
    color: #d41443;
    font-family: Titan One;
    font-size: 28px;
    font-style: normal;
    font-weight: 700;
    line-height: 1.3;
  }
}

.header-menu {
  margin-left: 110px;

  @media screen and (min-width: 320px) {
    display: none;
  }
  @media screen and (min-width: 1200px) {
    display: flex;
  }

  &__link {
    height: 100%;
    display: block;
    color: #ffffff;
    font-family: 'DM Sans';
    font-size: 16px;
    font-style: normal;
    font-weight: 500;
    line-height: 1.3;

    transition: color 250ms linear;

    &:hover,
    &:focus {
      color: #d41443;
    }
  }
}

.header-menu__item {
  color: #000000;
  &:not(:last-child) {
    margin-right: 35px;
  }
}

.button {
  border: 0px;
  border-radius: 22px;
  cursor: pointer;
}

.mobile-menu {
  display: block;
  margin-left: auto;
  padding-top: 23px;
  padding-right: 34px;

  border: none;
  background: none;

  @media screen and (min-width: 1200px) {
    display: none;
  }

  &__icon {
    display: flex;
    fill: #d41443;

    &--close {
      fill: #ffffff;
    }
  }
}

.menu-container {
  position: absolute;

  top: 0;
  right: 0;
  display: block;
  width: 40%;
  height: 100%;

  background-color: #e17992;
  z-index: 9999;
}

.gamburger-menu {
  &__item {
    padding-left: 24px;
    border-top: 1px solid #e18298;
    &:last-child {
      border-bottom: 1px solid #e18298;
    }
  }

  &__link {
    display: flex;
    align-items: center;
    height: 42px;

    color: #ffffff;
    font-weight: 500;
    font-size: 14px;
    line-height: 1.2;

    &:hover,
    &:focus {
      color: #c7133e;
    }
  }
}

.header__button {
  background-color: #ffffff;
  color: #d41443;
  width: 159px;
  height: 44px;

  font-size: 16px;
  font-family: 'DM Sans';
  font-style: normal;
  font-weight: 500;

  transition: 250ms linear;

  &:hover,
  &:focus {
    background-color: #ecebeb;
  }

  @media screen and (min-width: 320px) {
    display: none;
  }
  @media screen and (min-width: 768px) {
    display: block;
    margin-left: 30px;
  }

  @media screen and (min-width: 1200px) {
    margin-left: 110px;
  }
}

.header__button::after {
  content: '';
  width: 40px;
  height: 40px;
  margin-left: 15px;
  background-image: url('../images/afrikanka@1x.png');
}

.header__button::after {
  content: '';
}

.hero {
  position: relative;
  width: 100%;
  height: 100%;

  overflow: hidden;

  background-color: #ffb8ca;
}

.hero-container {
  position: relative;
  margin-left: auto;
  margin-right: auto;
  padding-left: 20px;
  padding-right: 20px;
  padding-top: 193px;

  width: 100%;
  height: 100%;

  z-index: 998;

  @media screen and (min-width: 320px) {
    width: 320px;
  }
  @media screen and (min-width: 768px) {
    width: 768px;
    padding-top: 102px;
    padding-left: 34px;
    padding-right: 34px;
    padding-bottom: 59px;
  }
  @media screen and (min-width: 1280px) {
    padding-top: 171px;
    padding-bottom: 102px;
    width: 1280px;
  }
}

.hero__title {
  position: relative;
  margin-bottom: 19px;
  width: 218px;

  color: #ffffff;
  z-index: 5;

  font-family: 'Titan One';
  font-size: 26px;
  font-weight: normal;
  line-height: 1.2;
  letter-spacing: 0.04em;
  text-transform: uppercase;

  @media screen and (min-width: 420px) {
    margin-bottom: 20px;
    font-size: 26px;
  }
  @media screen and (min-width: 768px) {
    width: 162px;
    font-size: 22px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 25px;
    font-size: 38px;
    width: 277px;
  }

  &--span {
    color: #d41443;
    font-size: 44px;

    @media screen and (min-width: 480px) {
      font-size: 40px;
    }
    @media screen and (min-width: 768px) {
      font-size: 32px;
    }
    @media screen and (min-width: 1280px) {
      font-size: 48px;
    }
  }
}

.hero__link {
  position: relative;
  z-index: 5;
  display: inline-flex;
  justify-content: center;
  align-items: center;
  // margin-bottom: 112px;
  width: 61px;
  height: 24px;

  border-radius: 20px;
  text-align: center;

  background-color: #d41443;
  color: #ffffff;

  font-family: 'DM Sans';
  font-size: 8px;
  line-height: 1.2;

  @media screen and (min-width: 320px) {
    margin-bottom: 160px;
  }
  @media screen and (min-width: 768px) {
    margin-bottom: 66px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 112px;
    width: 104px;
    height: 40px;
    font-size: 14px;
  }

  &:hover,
  &:focus {
    background-color: #c7133e;
  }

  transition: background-color 250ms linear;

  &--white {
    width: 82px;
    background-color: #ffffff;
    color: #d41443;
    margin-left: 15px;

    @media screen and (min-width: 1280px) {
      width: 138px;
    }

    &:hover,
    &:focus {
      background-color: #ecebeb;
    }
  }
}

.hero__description {
  // width: 200px;
  // height: 78px;

  @media screen and (min-width: 320px) {
    display: none;
  }
  @media screen and (min-width: 768px) {
    display: block;
    width: 114px;
    height: 48px;
    margin-left: 134px;
  }
  @media screen and (min-width: 1280px) {
    width: 200px;
    height: 78px;
    margin-left: 180px;
  }

  &--text {
    color: #ffffff;

    font-size: 8px;
    line-height: 1.4;
    margin-bottom: 20px;

    @media screen and (min-width: 1280px) {
      font-size: 14px;
    }
  }
}

.hero__description--arrow {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 18px;
  height: 18px;
  background-color: #ffffff;
  border-radius: 50%;
  transition: background-color 250ms linear;
  cursor: pointer;

  @media screen and (min-width: 1280px) {
    width: 26px;
    height: 26px;
  }
}

.hero__description--arrow:hover,
.hero__description--arrow:focus {
